* {
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

/*Colors variables*/
$colors: (
  primary-blue: #0facf3,
  primary-purple: #af81c9,
  primary-grey: #bbcddd,
  primary-white: #ffffff,
  light-grey: #bbcddc4d,
  light-blue: lighten(#0facf3, 30%),
  light-purple: lighten(#af81c9, 25%)
);

@function color($color-name) {
  @return map-get($colors, $color-name);
}

$shadows: (
  main-shadow: 0 2px 8px rgba(0, 0, 0, 0.1)
);

@function shadow($shadow-name) {
  @return map-get($shadows, $shadow-name);
}

@mixin transition($transition) {
  -webkit-transition: $transition;
  -ms-transition: $transition;
  -moz-transition: $transition;
  -o-transition: $transition;
  transition: $transition;
}

@mixin transform($transform) {
  -webkit-transform: $transform;
  -ms-transform: $transform;
  -moz-transform: $transform;
  -o-transform: $transform;
  transform: $transform;
}

%align-center {
  display: table-cell;
  vertical-align: middle;
  text-align: center;
}

%flex-center {
  display: flex;
  align-content: center;
  align-items: center;
  flex-wrap: wrap;
}

%journey-displays {
  width: 100%;
  height: 70px;
  border-bottom: 1px solid color(primary-blue);
  @extend %flex-center;
}

%icon-container {
  width: 30px;
  height: 30px;
  border-radius: 50%;
  color: color(primary-purple);
  display: table;
  margin-left: -13px;
  margin-right: 10px;
  background-color: color(primary-white);
  box-shadow: shadow(main-shadow);
}

body {
  font-family: "Roboto Condensed", sans-serif;
}

section {
  position: relative;
}

/*Navigation section starts here*/
nav {
  position: relative;
  @extend %flex-center;

  .navMainContainer {
    width: 100%;
    height: 80px;
    background-color: color(primary-white);
    // box-shadow: 0 2px 8px #ecdef4;
    box-shadow: 0 2px 8px color(light-purple);

    .logoLocationC {
      height: 80px;
      width: 80px;
      display: table;

      i {
        @extend %align-center;
        font-size: 70px;
        position: relative;
        color: color(primary-blue);

        .logoCar {
          width: 40px;
          height: 40px;
          position: absolute;
          top: 12px;
          right: 20px;
          border-radius: 50%;
          background-color: color(primary-white);
          display: table;

          i {
            font-size: 24px;
            @extend %align-center;
            color: color(primary-purple);
          }
        }
      }
    }
  }
}

.logoNameC {
  position: absolute;
  left: 70px;
  font-size: 25px;

  h4:first-child {
    color: color(primary-purple);
  }

  h4:last-child {
    color: color(primary-blue);
  }
}

.toggleNavContainer {
  position: absolute;
  right: 20px;
  top: 5px;
  width: 70px;
  height: 70px;

  .navInnerContainer {
    position: relative;
    height: 100%;
    width: 100%;
    border-radius: 50%;
    border: 10px solid color(light-blue);

    .navIconContainer {
      position: absolute;
      top: 50%;
      left: 50%;
      height: 75%;
      width: 75%;
      border-radius: 50%;
      background-color: color(primary-blue);
      @include transform(translate(-50%, -50%));

      .barContainer {
        position: absolute;
        top: 50%;
        left: 50%;
        @include transform(translate(-50%, -50%));

        .line1,
        .line2,
        .line3 {
          height: 2px;
          border-radius: 50px;
          width: 25px;
          background-color: color(primary-white);
          margin: 5px 0;
          @include transition(0.5s);
        }
      }
    }
  }
}

.navInnerContainer-hover {
  animation-name: zoomOut;
  animation-duration: 0.5s;
  animation-timing-function: ease-out;
  animation-delay: 0;
  animation-direction: alternate;
  animation-fill-mode: none;
  animation-play-state: running;
}

@keyframes zoomOut {
  0% {
    background-color: color(primary-white);
    border: 10px solid color(primary-white);
  }

  100% {
    background-color: rgba(15, 172, 243, 0.3);
    border: 10px solid rgba(15, 172, 243, 0.3);
  }
}

.crossIcon .line1 {
  @include transform(translate(0px, 7px) rotate(-45deg));
}

.crossIcon .line2 {
  opacity: 0;
}

.crossIcon .line3 {
  @include transform(translate(0px, -7px) rotate(45deg));
}

